import React from 'react';
import "./Main.css";
import { observer } from "mobx-react";
import MenuBar from '../MenuBar/MenuBar';

@observer
export default class Main extends React.Component<{}> {

    onLoad = () => {

    }

    render() {
        return (
            <div className={'outermost'}>
                <MenuBar
                    onLoad={this.onLoad}
                    transitionDuration={3000}
                />
            </div>
        )
    }

}
